import React from 'react';
import Hospital from './components/Hospital';
import './App.css';
import Registration from './components/Registration';
import {BrowserRouter as Router ,Switch, Route} from "react-router-dom";



function App() {
  return (
    <>
    <Router>
      <Switch>
        <Route path ="/Hospital">
          <Hospital/>
        </Route>
        <Route path ="/register">
          <Registration/>
        </Route>
      </Switch>
    </Router>




    </>
  );
}

export default App;
